import React from 'react';
import { useParams } from 'react-router-dom';

const Pages = (props) => {   
    let { page } = useParams();
    if(typeof page === 'undefined'){ 
        page = props.page 
    }
console.log(page)
    return (
        <div className="container-fluid p-0">
            <section className="resume-section">
                I am pages component. {page}
            </section>
        </div>
    );
}


export default Pages;
